const toggles = (state = {
    signin: true,
    signup: true
}, action) => {
    switch (action.type) {
        case 'TOGGLE_SIGNIN_BUTTON':
            return { signin: !state.signin, ...state }
        case 'SIGNED_IN':
            console.log('i should be here')
            console.log({ signin: false, signup: state.signup })
            console.log({ ...state })
            return { signin: false, ...state }
        default:
            return state
    }
}

export default toggles
